import axios from 'axios';
import { fetchdata } from '../Redux/Actions/fetchdataAction';
import { LoaderAction } from '../Redux/Actions/LoaderAction';
import { GetAuth1 } from '../Redux/Actions/UserAction';
import { AuthUrl, DataUrl } from './Url';

async function getdata(dispatch) {

  try {
    const response = await axios.get(DataUrl);
    dispatch(fetchdata(response.data))

  } catch (error) {

    console.error(error);
  }
}

async function Auth(dispatch, data) {
debugger
  axios.post(AuthUrl, data)
    .then(function (response) {
      if (response.data==null) {
   
        sessionStorage.getItem("UserLogin", null);
      }
      if (response.data!=null) {
       
        sessionStorage.getItem("UserLogin", response.data.Username);
        // dispatch(GetAuth1(response.data))

      }
      dispatch(LoaderAction(false))
    })
    .catch(function (error) {
      console.log(error);
      dispatch(LoaderAction(false))
    });
}
export { getdata, Auth }
